import React from 'react';
import {CarouselData} from './carousel_data';
import img1 from './carousel_img/753.jpg';


class CarouselInner extends React.Component{
  render(){
    return(
      <div>
      {CarouselData.map((item,index) => {
        <div key={index} className="carousel-inner">
          <div className="carousel-item">
            <center><img src={item.image} alt="recycle"/></center>
            <div className="carousel-caption">
            {item.text}
            </div>
          </div>
        </div>
      })}
      </div>
    )
  }
}
export default CarouselInner
